import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find the first "Add to Cart" button and click it
    const addToCartButton = page.locator('.add-to-cart').first();
    await addToCartButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToCartButton.click();

    // Wait for the cart count to update
    await page.waitForSelector('.cart:has-text("1")', { timeout: 5000 });

    // Take a screenshot after adding the product to the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_added.png'));

    // Extract the cart text to verify
    const cartText = await page.locator('.cart').textContent();

    return {
      success: true,
      action: "Added the first product to the cart and verified the cart count updated.",
      extractedData: {
        cartText: cartText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
